import { Link } from 'react-router-dom';

function NavBar() {
    const navStyle = {
        background: 'black',
        color: 'white',

    };

    return (
        <nav style={navStyle}>
            <Link to="/">HOME</Link>
            <Link to="/gallery">GALLERY</Link>
            <Link to="/contact">CONTACT</Link>
            <Link to="/shop">SHOP</Link>
        </nav>
    );
}

export default NavBar;
